import React, { Component} from "react"
import data_json from "./Components/states.json"
import us_states from "./Components/csvjson.json"
import "./App.css"
import Navbar from "./Components/Navbar"
import Section from "./Components/Section"
import dummyText from "./DummyText"
import ReactFlexyTable from 'react-flexy-table'
import 'react-flexy-table/dist/index.css'
import USAMap from "react-usa-map";
//import GeoChart from "./Components/GeoChart"


class App extends Component {
  /* mandatory */
  mapHandler = (event) => {
    alert(event.target.dataset.name);
  };



//console.log("json data: ", data_json.features)

// returns App Components
render(){
    return (
      <div className="App">
        <Navbar />
        <Section
          title="Financial Literacy in The U.S."
          subtitle={"Click on the state to see financial literacy grade"}
          content={<USAMap onClick={this.mapHandler} />}
          dark={false}
          id="section1"
        />
        <Section
          title="Section 2"
          subtitle={"Data Table Overview"}
          content={<ReactFlexyTable data={us_states}/>}
          dark={false}
          id="section2"
        />
        <Section
          title="Section 3"
          subtitle={dummyText}
          dark={true}
          id="section3"
        />
        <Section
          title="Section 4"
          subtitle={dummyText}
          dark={false}
          id="section4"
        />
        <Section
          title="Section 5"
          subtitle={dummyText}
          dark={true}
          id="section5"
        />
      </div>
    );
}}
export default App;
